import React from 'react';
import s from './Category.module.css';

import {BrowserRouter, Router, Routes, Route, Switch, NavLink} from "react-router-dom";

const Category = (props) => {
  return (
      <Routes>
        <div className={s.category}>
          <NavLink className={s.categoryName} to={props.nameCategory.toLowerCase()}>
            <div className={`${s.categoryLogoEclipse} ${s.categoryLogo}`}>
              <img className={s.categoryLogo} src={props.imgPath} alt={''}/>
            </div>
            {props.nameCategory}
          </NavLink>
        </div>
      </Routes>
  );
};

export default Category;
